public class InnerRouteHttpRouteFactory(Action<Humidifier.AppMesh.RouteTypes.HttpRoute> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.RouteTypes.HttpRoute>
{

    internal InnerRouteHttpRouteActionFactory ActionFactory { get; set; }

    internal InnerRouteHttpTimeoutFactory TimeoutFactory { get; set; }

    internal InnerRouteHttpRetryPolicyFactory RetryPolicyFactory { get; set; }

    internal InnerRouteHttpRouteMatchFactory MatchFactory { get; set; }

    protected override Humidifier.AppMesh.RouteTypes.HttpRoute Create()
    {
        var httpRouteResult = CreateHttpRoute();
        factoryAction?.Invoke(httpRouteResult);

        return httpRouteResult;
    }

    private Humidifier.AppMesh.RouteTypes.HttpRoute CreateHttpRoute()
    {
        var httpRouteResult = new Humidifier.AppMesh.RouteTypes.HttpRoute();

        return httpRouteResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.RouteTypes.HttpRoute result)
    {
        base.CreateChildren(result);

        result.Action ??= ActionFactory?.Build();
        result.Timeout ??= TimeoutFactory?.Build();
        result.RetryPolicy ??= RetryPolicyFactory?.Build();
        result.Match ??= MatchFactory?.Build();
    }

} // End Of Class

